import React from 'react';
import './App.css';
import Todos from './components/Todos';
import {Todo} from './models/todo'

function App() {

  const todos = [new Todo('lalal'), new Todo('lololo')]

  return (
    <div>
      <Todos items={todos} />
    </div>
  );
}

export default App;
